// Your PAT (Personal Access Token) can be found in the portal under Authentification
const IMAGE_BYTES_STRING =
  "";

async function get(image_bytes) {
  const raw = JSON.stringify({
    user_app_id: {
      user_id: "clarifai",
      app_id: "main",
    },
    inputs: [
      {
        data: {
          image: {
            base64: image_bytes,
          },
        },
      },
    ],
  });

  const requestOptions = {
    method: "POST",
    headers: {
      Accept: "application/json",
      Authorization: "Key " + CLARAFAI_KEY,
    },
    body: raw,
  };

  // NOTE: MODEL_VERSION_ID is optional, you can also call prediction with the MODEL_ID only
  // https://api.clarifai.com/v2/models/{YOUR_MODEL_ID}/outputs
  // this will default to the latest version_id

  return fetch(
    `https://api.clarifai.com/v2/models/food-item-recognition/versions/1d5fd481e0cf4826aa72ec3ff049e044/outputs`,
    requestOptions
  )
    .then((response) => response.json())
    .then((result) => {
      return result;
    })
    .catch((error) => console.log("error", error));
}

function getHealthData(foodRes) {
  const results = {};
  for (let i = 0; i < foodRes.length; i++) {
    const food = foodRes[i];
   
    for (const category in foods) {
    
      if (foods[category].includes(food)) {
        if (category in results) {
          results[category].total += 1;
          results[category].foods.push(food);
        } else {
          results[category] = {}
          results[category].total = 1;
          results[category].foods = [food];
        }
      }
    }
  }
 
  return results;
}
